import React, { Component } from 'react';

class selectionChips extends Component {
    constructor(props)
    {
        super(props)
        this.state = {
            selectionChips: [
                {
                    Title: 'Enabled',
                    class: 'form-group input-chips',
                    type: [
                        {
                            selected: selectd,
                            hover: hovered,

                        }
                    ],

                },
                {
                    Title: 'Disabled',
                    class: 'form-group input-chips',
                    type: [
                        {
                            selected: selectd,
                            hover: hovered,

                        }
                    ]
                },
                {
                    Title: 'Hover',
                    class: 'form-group input-chips',
                    type: [
                        {
                            selected: selectd,
                            hover: hovered,

                        }
                    ]
                },
                {
                    Title: 'Selected',
                    class: 'form-group input-chips',
                    type: [
                        {
                            selected: selectd,
                            hover: hovered,

                        }
                    ]
                },
            ],
        }
    }
    render() {
        return (
            <div className="input-chips-wrapper">
                <div className="row">
                    <div className="col-md-4">
                        {this.state.selectionChips.map(chipsList => 
                            <div className={chipsList.class}> 
                                <input type="text" readOnly  value={chipsList.Title}/>
                            </div>
                        )}
                    </div> 
                </div>
            </div>
        );
    }
}

export default selectionChips;
